import React from "react";
import styled from "styled-components";

const FoodTypeContainer = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  height: 100vh;
`;

const FoodTypeButton = styled.button`
  padding: 10px 20px;
  margin: 10px;
  font-size: 16px;
  cursor: pointer;
`;

function FoodTypeSelection({ onSelect }) {
  return (
    <FoodTypeContainer>
      <h1>어떤 종류의 음식을 원하시나요?</h1>
      <FoodTypeButton onClick={() => onSelect("rice")}>밥</FoodTypeButton>
      <FoodTypeButton onClick={() => onSelect("noodles")}>면</FoodTypeButton>
      <FoodTypeButton onClick={() => onSelect("meat_seafood")}>
        고기/해물
      </FoodTypeButton>
    </FoodTypeContainer>
  );
}

export default FoodTypeSelection;
